import React from "react";
import { Container } from "react-bootstrap";
import Product from "./Product";

function SectionHeader(props) {
  return (
    <Container className="text-center my-4">
      <h6>{props.header}</h6>
      <hr className="w-90 mx-auto text-dark" />
    </Container>
  );
}

function ProductBox() {
  return (
    <Container>
      {/* Product List */}
      <Container className="my-4 d-flex flex-row justify-content-evenly">
        <div className="d-flex flex-column align-items-center">
          <Product img='https://www.junaidjamshed.com/media/catalog/product/2/4/24-1950_1_.jpg?width=436&height=560&canvas=436,560&optimize=medium&bg-color=255,255,255&fit=bounds' oldprice='4,490.00' product_name='PINK KHADDI EMBROIDERED 3PC STITCHED' newprice="3,592.00" discount='' />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
      </Container>
    </Container>
  );
}

export default ProductBox;
